As complexity increases even a creator cannot know: there is no single causal factor.

A bird's eye of the recent ML golden age = great; some constants that are coming thro:
- hierarchy at different time &amp; scale resolutions;
- simple components used in clever ways;
- changing focus over time (attention); +
- encoding/decoding to allow continuous representations.

Low hanging fruit for automating patent drafting:
- dictionaries of compound terms for consistent usage;
- reference numeral checks;
- antecedence checks;
- coverage checks (e.g. claims vs. specification); and
- simple, repetitive sections (e.g. Summary / Figure Description).

